import React from 'react';
import './body.css';
import PictureAbout from '../../images/PictureAbout.png'

const Section1 = () => {
    return (
        <div id="FirstSection">
            <div class="Box-Picture-About"><img src={PictureAbout} class="PictureAbout"></img></div><div class="Box-Text-About">
                <p class="About">
                    Estudante de Análise e Desenvolvimento de Sistemas, cursando o 4° semestre.
                </p>

                <br></br>

                <p class="About">
                    Tenho grande interesse pela área desenvolvimento web, atualmente estou estudando as tecnologias HTML5, CSS3, JavaScript, Bootstrap e React.
                </p>

                <br></br>

                <p class="About">
                    Gosto muito de me relacionar com as pessoas, tenho grande senso de trabalho em equipe e busco melhorar cada vez mais minhas competências profissionais.
                </p>
            </div>


        </div >
    )
};

export default Section1;
